class Head_Banner extends React.Component {
  render() {
    <div className="head_banner border">
      <div className="container border">
        <span id="text_1">SAFE INVESTMENT</span>
        <span id="text_2">Safest Investment Here</span>
      </div>
    </div>;
  }
}

export default Head_Banner;
